TweetText:
Ein dogmatisch geführter #Täter-#Opfer-Diskurs wie neulich im 
@WDR
 sorgt für etliche Kuriositäten, beispielhaft beim linken Paradoxon, dass es gar keine genuin deutsche #Identität gäbe, aber alle ausländischen Minderheiten in #Deutschland eine ...

... sich in der 
@AfD
 seit Jahren für eine familienfreundliche Zukunft einsetzen und die ein Problem mit schlechter Politik haben. Aber bestimmt nicht mit der #Verfassung.

Unkameradschaftlicher kann man sich nicht positionieren. Wir wollen eine starke #Bundeswehr, die aber nicht Weltpolizist spielt. Die 
@SPD
 hingegen steht für gefährliche Einsätze bei schlechter Ausrüstung und geringer Wertschätzung unserer #Soldaten.

Endlich wieder #Verteidigungspolitik mit den MdB 
@MdB_Lucassen
, 
@Gerold_Otten
, Jens Kestner und 
@ElsnervonGronow
 in Berlin. Themen waren der Haushalt 2021, sowie einige Anträge und weitere Initiativen.

Gestern waren meine Mitstreite & ich in Karben. Thema war die Arbeit der 
@AfDimBundestag
. 
@andreaslichert
 führte durch den Abend. Es war eine gute Veranstaltung mit vielen Gästen, was in #Corona-Zeiten & angesichts all der Auflagen keine Selbstverständlichkeit ist.

Gestern haben 
@JoanaCotar
 und ich das EloKa (elektronische Kampfführung) Btl 931 in Daun besucht. Es hat unter anderem den Auftrag, Fernmeldeverkehre ortsfest und mobil aufzuklären und auszuwerten und trägt auf vielfältige Weise zum Schutz unserer #Soldaten bei.

Endlich wurde den Nazis und #Rassisten eine ihrer wichtigsten Devotionalen genommen: Der Aufheller von 
@LOrealParisUSA
, der in keiner Neonazi-Kameradschaft fehlen darf, wurde vom Markt genommen. Jetzt wird alles besser.

Gruß von 
@David_Bendels
 und mir aus #Berlin! Heute werde ich im #Bundestag zum Thema Autonome Waffensysteme sprechen. Ein Video zu diesem und anderen Themen gibt’s dann im Deutschland Kurier.

Die verdächtige Sendung war an 
@BjoernHoecke
 adressiert.OTZ Online
